function getDataBase(lengths){
  // 글자 수 데이터베이스
  var m_db = getData();
  var dbse = m_db.length;
  var returns = [];
  for (i=0; i<dbse; i++){
    if (m_db[i].length == lengths){
      returns[returns.length] = m_db[i];
    }
  }
  return returns;
}
